Object.Field:
    	import oracle.odi.mapping.generation.AbstractSyntaxTree.ASTProducerMethod;
		import oracle.odi.domain.mapping.generator.KMGeneratorDelegateRegistry.GeneratorDelegateClass;
    	@GeneratorDelegateClass(componentType="AP", descriptionKey="GeneratorDelegateClass.LKMHiveToHBase")
        public class LKM_Hive_to_HBase_Incremental_Update_HBASESERDE_Direct extends HiveBaseLKM {
            def tgtTableAST, tgtAST, hiveHBaseTableAST
            def hiveSourceQuery
            boolean option_CREATE_TARG_TABLE, option_TRUNCATE

            public LKM_Hive_to_HBase_Incremental_Update_HBASESERDE_Direct() {}
    	    // class constructor; initialization is done in setBinding method

            /**
             * Create a SqlQuery AST representing inputQuery plus any pushed expressions 
             * of the current node
             * @param inputQuery The upstream AST
             * Copied from LKM_SQL_to_SQL_v2
             */
            protected SqlQuery getTgtSelectQuery(SqlQuery inputQuery) {
                List<ISelectItem> newSelectList = new ArrayList<ISelectItem>();
                List<StringExpression> newAliasList = new ArrayList<StringExpression>();

                def targetNode = physicalNode.getParentNode()
                List<MapAttribute> attrs = targetNode.getLogicalComponent().getAttributes();
                for (MapAttribute attr : attrs) {
                    // for each target attribute, either create an array expression node that represents a simple reference to the attribute...
                    if (attr.isMapped()) {                            
                        def aliasName = attr.getSQLAliasName( getHiveTechnology() )
                        newSelectList.add(new ArrayExpression(targetNode, attr, null, inputQuery));
                        newAliasList.add(new StringExpression( aliasName )); 
                    }
                }

                SqlQuery result = inputQuery.clone();
                result.setSelectList(newSelectList);
                result.setAliasList(newAliasList);
                return result;
            }

            public void setBinding( Binding binding ) {
             	super.setBinding( binding )
                 // Initialize variables
                 option_CREATE_TARG_TABLE      = isOptionTrue( "CREATE_TARG_TABLE" )
                 option_TRUNCATE               = isOptionTrue( "TRUNCATE" )
             }

             void updateBinding() {
             	 super.updateBinding()
                 // Publish variables into binding to make them available in templates and variableDefText
                 mBinding.setVariable( "option_CREATE_TARG_TABLE",      option_CREATE_TARG_TABLE ) 
                 mBinding.setVariable( "option_TRUNCATE",               option_TRUNCATE )                         
                 mBinding.setVariable( "tgtTableAST",  tgtTableAST )
                 mBinding.setVariable( "tgtAST",       tgtAST )
                 mBinding.setVariable( "hiveHBaseTableAST",  hiveHBaseTableAST )
             }    	

			@ASTProducerMethod(processingType=ProcessingType.TARGET, producedASTType=HiveInsertStatement.class, styleKey="ProcessingStyleKey.HBase.INSERT")
            AbstractSyntaxTree INSERT( SqlQuery input ) {        
                // Find target DataStore
                def targetNode = physicalNode.getParentNode()
                def targetDataStore = targetNode.getLogicalComponent().getBoundDataStore()
                def hBaseTableName  = targetDataStore.getResourceName()

                // Include all source-side expressions into the query AST
                hiveSourceQuery = getTgtSelectQuery( input )

                // Create DDL for HBase-Hive table
                def hiveHBaseTableName = generatorContext.generateUniqueAlias(physicalNode)  //generatorContext.getAPNodeCollTableAccessName()
                def tableQualifier = physicalNode.getLocation() == null ? null : physicalNode.getLocation().getName();
                def customTgtText = '''<?=odiRef.getObjectName("L", "%COL_PRF''' + hiveHBaseTableName + '''", "W")?>'''
                def hiveHBaseTable = new HiveTable( hiveHBaseTableName, tableQualifier, customTgtText, false, true )

                hiveHBaseTableAST = getHiveHBaseSerDeTable( hiveHBaseTable, hBaseTableName, physicalNode )
                tgtTableAST = hiveHBaseTableAST

                // Create AST for insert into Hive-HBase-SerDe table
                def hiveHBaseColumnList = targetNode.getAllPhysicalExpressions().collect { expr -> Column.getColumn( hiveHBaseTable, expr.getRefObject() ) }              
                def intoTargetAST = new HiveInsertStatement( hiveHBaseTable, hiveHBaseColumnList, hiveSourceQuery, ffFinder )
                // Command must be executed on source (Hive)
                intoTargetAST.setHasSourceAndTargetText( true )                
                initTargetAST( intoTargetAST )                

                // We do not need a standard Hive staging table
                stgTableAST = null
                // We cannot use standard Prepare-Hive-Session, as Hive connection is on source here
                prepareHiveSession = false

                // Publish variables into binding to make them available in templates and variableDefText
                updateBinding()
                return intoTargetAST
            }
        }
